#div1 {
    width: 600px;
    height: 600px;
    position: absolute;
    animation: mymove 60s infinite alternate;
    animation-timing-function: linear;
}
#div2 {
    width: 700px;
    height: 700px;
    position: absolute;
        animation: mymovei 100s infinite alternate;
        animation-timing-function: ease;

}

#div3 {
    width: 200px;
    height: 200px;
    position: absolute;
        animation: mymove 60s infinite alternate;
        animation-timing-function: ease-in;
}



#div4 {

    height: 800px;

}


#div5 {

#div8 {

/* Standard syntax */
@keyframes mymove {
    from {left: 0px;}
    to {left: 900px;}
}

@keyframes mymovei {
    from {left: 0px;}
    to {left: 900px;}
}

@keyframes mymoveii {
    from {left: -100px;}
    to {left: 1200px;}
}
